import React from "react";
import { Text, Box, Container, Center } from "native-base";
import { Dimensions } from "react-native-web";

const { width, height } = Dimensions.get("window");

const App = () => {
  return (
    <Center 
      justifyContent={"center"}
      alignItems={"center"}

    >
      <Box w={width / 2} h={height / 2} borderWidth="1">
        <Text>FA</Text>
      </Box>
    </Center>
  );
};

export default App;
